import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div classNameName="page">
       <header className="header">
        <div className='header-container'></div>
        <img className="header__logo" alt="Логотип Россия" src="images/sprint-3-images/header-logo.svg"/>
        <div className="header__lang-links">
            <a href="#" className="header__lang-link">Ru</a>
            <a href="#" className="header__lang-link">En</a>
        </div>
    </header>

    </div>
  );
}

export default App;
